import React from 'react'
import './Navig.style.css'

import {Nav,NavbarToggler,Collapse, Navbar, NavbarBrand, Col, Row} from 'reactstrap'

import{NavigReus} from './NavigationReus'



class Navig extends React.Component {
    constructor(props){
        super(props);
        this.state ={
            isNavOpen: false
        }
    }

    openOrClose = () =>{
        this.setState({
            isNavOpen: !this.state.isNavOpen
        })
    }


    render(){
    return(
        <Navbar light sticky='top' expand='md'>
            <Container fluid="">
                <Row  >
                    <Col xs='6'>
                        <NavbarBrand className='mr-auto' href="/home">
                            <img src='https://media.giphy.com/media/JmPabUqU22FAbQYkzN/giphy.gif' alt='robotlogo' width='20%' height='20%' />
                        </NavbarBrand>
                    </Col>

                    <Col xs='6'>
                        <NavbarToggler className='ml-auto' onClick={this.openOrClose} />
                        <Collapse isOpen={this.state.isNavOpen} navbar>
                            <Nav navbar>
                                <NavigReus link={'home'} name={'Home'}/>
                                <NavigReus link={'info'} name={'About Us'}/>
                            </Nav>
                        </Collapse>
                    </Col>
                </Row>
            </Container>
        </Navbar>               
    )
    }
}

export default Navig
